import React, { Component } from 'react'

class Exercise extends Component {
    state = { 
        title:['t1', 't2','t3'],
        genre:['g1', 'g2','g3'],
    } 
    render() { 
        return (
            <React.Fragment>
                <ul className='d-inline-block'>
                    {this.state.title.map(title => <li key ={title}>{ title }</li>)}
                </ul>

                <ul className='d-inline'>
                    {this.state.genre.map(genre => <li key ={genre}>{ genre }</li>)}
                </ul>
            </React.Fragment>
        );
    }
}
 
export default Exercise;
